import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-level1-game',
  templateUrl: './level1-game.component.html',
  styleUrls: ['./level1-game.component.css']
})
export class Level1GameComponent {
  public word1: string='';
  public word2: string='';
  public word3: string='';
  public word4: string='';

  constructor(private route: ActivatedRoute , private router: Router) {}

  internet(){
    this.router.navigate(["/level2"],{ queryParams: { data4: this.word1 } });
  }

  data(){
    this.router.navigate(["/level2"],{ queryParams: { data5: this.word2 } });
  }

  system(){
    this.router.navigate(["/level2"],{ queryParams: { data6: this.word3 } });
  }

  application(){
    this.router.navigate(["/level2"],{ queryParams: { data7: this.word4 } });
  }
}
